import React from 'react';
import InputDatalist from '../../UserInterface/Input/InputDatalist';
import { countries } from '../../constans/countries';
import Photogallery from '../../components/Photogallery/Photogallery';
import { image } from '../../constans/ImageGallery/image';
import iceBaikal from '../../image/iceBaikal.jpg';

function Home (props){
    
    return(
         <div>
                <div className="">
                    HOME
                </div>
            <nav>
                <a href="/ViewType">
                    <img src={iceBaikal} width="50" height="50" alt="iceBaikal" />
                </a>
            </nav>

            <InputDatalist
                arrValue={countries}
                id="countriesInput"
                listId="countriesListId"
                placeholder="country"
                onchange={() => console.log('Input coutry')}
                tabindex="1"
                autocomplete = "off"
            />
            <Photogallery
                imageArr={image}
            />
                
        </div>
    )
}

export default Home
